const theme = createTheme({
  palette: {
    background: {
      paper: '#fff',
    },
    text: {
      primary: '#173A5E',
      secondary: '#46505A',
    },
    action: {
      active: '#001E3C',
    },
    success: {
      dark: '#009688',
    },
  },
});

// <ThemeProvider theme={theme}>

*/

const theme = createTheme();

export default function App() {

    const [data, setData] = useState([])

    const getData = () => {
        setData(GetData())
    }

    useEffect(() => {
        getData()
    }, [])    

    console.log(data)

    return (
    <Container>
      <CssBaseline />
      <Header />

      /* <Button variant="contained">Hello World</Button>
      */

      <Grid2 container spacing={4}>

      {
         data && data.length>0 && data.map( record => {
             return(
                <Grid2 item xs={6} md={4}>
                  <MyCard title="{record.recipes[0].title}" subheader="{record.recipes[0].sourceName}" />
                </Grid2>
             )
         })
      }

        <Grid2 item xs={6} md={4}>
          <MyCard title="Test" subheader="Test" />
        </Grid2>

        <Grid2 item xs={6} md={4}>
          <MyCard />
